      {/* Left SideBar */}
      {/* SmallBox - Balance */}
      {/* SmallBox - Bitcoin */}
      {/* SmallBox - Terracoin */}
      {/* SmallBox - ZCoin */}
      {/* SmallBox - Ethereum */}
      {/* LongBox - Recent Operations */}
      {/* HorizontalBox - Buy/Sell Coins */}
      {/* LargeBox - Graph (BTC) */}
      {/* LargeBox - Graph (TRC)*/}
      {/* LargeBox - Graph (XZC)*/}
      {/* LargeBox - Graph (ETC)*/}
      {/* SmallBox (Unique Props) - Assets*/}
    </div>
  );
}

export default App;
